description:
Pretty Woman - A XXX Parody (2012) 

Night. Hollywood Boulevard. Bright lights, big city. Sexy girls walking along the star-studded world-renown famous strip in miniskirts and thigh-high boots. Vivian gets dressed for the night in a cheap apartment above the street. Edward, a wealthy businessman from out of town, is lost on his way to Beverly Hills. A wrong turn lands him in Hollywood, where he meets Vivian and her roommate Laura on the street. He agrees to pay Vivian if she will help him get back to his hotel. An intriguing conversation develops between them, and by the time they reach his luxurious suite, they are both interested in getting to know each other a little more.

Otto Bauer, Mark Wood, Alec Knight, Dana De Armond, Chris Johnson, Melissa Jacobs, Jada Stevens, Madison Ivy, Alexa Nicole, Jayden Cole

Feature, Couples, Parody/Spoof

